import React, {Component, useState} from "react";
import {connect, Provider} from "react-redux";
import {Router, Route, Link, withRouter, Switch} from "react-router-dom";
import history from '../history';

import Navi from "./Navi";
import Body from "./body";
import Login from "./login";
import Register from "./register";
import Home from "./home";
import Debit from "./debit";
import Credit from "./credit";
import Wallets from "./Wallets";
import Status from "./status";
import Statement from "./statement";
import Default from "./default";
import Footer from "./footer";
import Deleteusers from "./deleteusers";
import DailyReport from "./DailyReport";


// const mapStateToProps=state=>{
//     return
//     {
//         name     : state.name;
//         password : state.password;
//     }
// }

class Main extends Component
{

    constructor() {
        super();
        this.state = {
            username:'',
            loggedIn:false,
            users:[],
            data:[]

        };
    }




    render() {

     //  const {loggedIn}= useState(localStorage.getItem("token"));

        return(

                <div className="App">


                    <Router history={history}>

                        <Navi  />
                        <Route exact path='/' component={Body} />
                        <Route path='/log' component={Login} />
                        <Route path='/register' component={Register}/>
                        <Route path='/home' component={Home}/>
                        <Route path='/debit' render={(props) => <Debit {...props} />}/>
                        <Route path='/credit' component={Credit}/>
                        <Route path='/wallets' component={Wallets}/>
                        <Route path='/status' component={Status}/>
                        <Route path='/statement' component={Statement}/>
                        <Route path='/default' component={Default}/>
                        <Route path='/deleteusers' component={Deleteusers}/>
                        <Route path='/dailyreport' component={DailyReport}/>
                        <Footer/>

                    </Router>
                </div>
        )
    }

    log_api(value)
    {
            const api = '/login';
            const request = {
                method: 'POST',
                headers: {'Accept': 'application/json', 'Content-Type': 'application/json'},
                body: JSON.stringify(value)
            };

            fetch(api, request)
                .then((response) => (response.json()))
                .then(res => this.setState({data: res}))
                .then((data) => console.log('logged in'))
                .then(this.setState({loggedIn: true}))
                .catch(err => {
                    this.setState({errorMessage: err.message});
                })
    }

}
export default Main;
